import { FunctionComponent, useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import Card from "../interfaces/Card";
import { getCardById } from "../services/cardsServices";

interface CardInfoProps {}

const CardInfo: FunctionComponent<CardInfoProps> = () => {
  let { id } = useParams();
  let navigate = useNavigate();

  let [card, setCard] = useState<Card>({
    title: "",
    subTitle: "",
    description: "",
    phone: "",
    email: "",
    web: "",
    imageUrl: "",
    imageAlt: "",
    state: "",
    country: "",
    city: "",
    street: "",
    houseNumber: 0,
    zip: "",
  });

  useEffect(() => {
    getCardById(Number(id))
      .then((res) => {
        console.log(res.data);
        setCard(res.data);
      })
      .catch((error) => console.log(error));
  }, []);
  return (
    <>
      <div className="card">
        <div className="card-header">Full business information</div>
        <div className="col-md-4">
          <img src={card.imageUrl} className="img-fluid rounded-start " alt={card.imageAlt} />
        </div>
        <div className="card-body">
          <h5 className="card-title">{card.title}</h5>
          <p className="card-text">{card.subTitle} </p>
          <a href="#" className="btn btn-primary">
            Go somewhere
          </a>
        </div>
      </div>
    </>
  );
};

export default CardInfo;
